import React from "react";

import { AppWrap } from "../../wrapper";
import "./Contact.scss";

const Contact = () => {
  return (
    <>
      <h2 className="head-text">Contact</h2>
      <div className="app__contact-cards">
        <i class="fa-solid fa-envelope"></i>
      </div>
    </>
  );
};

export default AppWrap(Contact, "contact");
